CREATE DATABASE DEMO;

\c demo


DROP TABLE IF EXISTS EmployeeSales;
DROP TABLE IF EXISTS Employees;

CREATE TABLE Employees (
    EmployeeID INTEGER PRIMARY KEY,
    FirstName TEXT,
    EmployeeName TEXT,
    LastName TEXT,
    Title TEXT,
    Country TEXT,
    City TEXT,
    Address TEXT,
    HomePhone TEXT,
    Notes TEXT
);

CREATE TABLE EmployeeSales (
    SaleID INTEGER PRIMARY KEY,
    Title TEXT,
    Description TEXT,
    Useless TEXT,
    StartTimezone TIMESTAMP,
    Wasted TEXT,
    EndTimezone TIMESTAMP,
    RecurrenceRule TEXT,
    RecurrenceID TEXT,
    RecurrenceException TEXT,
    IsAllDay BOOLEAN,
    EmployeeID INTEGER REFERENCES Employees(EmployeeID)
);


