INSERT INTO Employees (EmployeeID, FirstName, EmployeeName, LastName, Title, Country, City, Address, HomePhone, Notes) VALUES ('2', 'Andrew', 'Andrew Fuller', 'Fuller', 'Vice President, Sales', NULL, NULL, NULL, '(206) 555-9482', 'Andrew received his BTS commercial in 1974 and a Ph.D. in international marketing from the University of Dallas in 1981.  He is fluent in French and Italian and reads German.  He joined the company as a sales representative, was promoted to sales manager in January 1992 and to vice president of sales in March 1993.  Andrew is a member of the Sales Management Roundtable, the Seattle Chamber of Commerce, and the Pacific Rim Importers Association.');
INSERT INTO Employees (EmployeeID, FirstName, EmployeeName, LastName, Title, Country, City, Address, HomePhone, Notes) VALUES ('9', 'Anne', 'Anne Dodsworth', 'Dodsworth', 'Sales Representative', NULL, NULL, NULL, '(71) 555-4444', 'Anne has a BA degree in English from St. Lawrence College.  She is fluent in French and German.');
INSERT INTO Employees (EmployeeID, FirstName, EmployeeName, LastName, Title, Country, City, Address, HomePhone, Notes) VALUES ('3', 'Janet', 'Janet Leverling', 'Leverling', 'Sales Representative', NULL, NULL, NULL, '(206) 555-3412', 'Janet has a BS degree in chemistry from Boston College (1984).  She has also completed a certificate program in food retailing management.  Janet was hired as a sales associate in 1991 and promoted to sales representative in February 1992.');
INSERT INTO Employees (EmployeeID, FirstName, EmployeeName, LastName, Title, Country, City, Address, HomePhone, Notes) VALUES ('8', 'Laura', 'Laura Callahan', 'Callahan', 'Inside Sales Coordinator', NULL, NULL, NULL, '(206) 555-1189', 'Laura received a BA in psychology from the University of Washington.  She has also completed a course in business French.  She reads and writes French.');
INSERT INTO Employees (EmployeeID, FirstName, EmployeeName, LastName, Title, Country, City, Address, HomePhone, Notes) VALUES ('4', 'Margaret', 'Margaret Peacock', 'Peacock', 'Sales Representative', NULL, NULL, NULL, '(206) 555-8122', 'Margaret holds a BA in English literature from Concordia College (1958) and an MA from the American Institute of Culinary Arts (1966).  She was assigned to the London office temporarily from July through November 1992.');
INSERT INTO Employees (EmployeeID, FirstName, EmployeeName, LastName, Title, Country, City, Address, HomePhone, Notes) VALUES ('6', 'Michael', 'Michael Suyama', 'Suyama', 'Sales Representative', NULL, NULL, NULL, '(71) 555-7773', 'Michael is a graduate of Sussex University (MA, economics, 1983) and the University of California at Los Angeles (MBA, marketing, 1986).  He has also taken the courses "Multi-Cultural Selling" and "Time Management for the Sales Professional."  He is fluent in Japanese and can read and write French, Portuguese, and Spanish.');
INSERT INTO Employees (EmployeeID, FirstName, EmployeeName, LastName, Title, Country, City, Address, HomePhone, Notes) VALUES ('1', 'Nancy', 'Nancy Davolio', 'Davolio', 'Sales Representative', NULL, NULL, NULL, '(206) 555-9857', 'Education includes a BA in psychology from Colorado State University in 1970.  She also completed "The Art of the Cold Call."  Nancy is a member of Toastmasters International.');
INSERT INTO Employees (EmployeeID, FirstName, EmployeeName, LastName, Title, Country, City, Address, HomePhone, Notes) VALUES ('7', 'Robert', 'Robert King', 'King', 'Sales Representative', NULL, NULL, NULL, '(71) 555-5598', 'Robert King served in the Peace Corps and traveled extensively before completing his degree in English at the University of Michigan in 1992, the year he joined the company.  After completing a course entitled "Selling in Europe," he was transferred to the London office in March 1993.');
INSERT INTO Employees (EmployeeID, FirstName, EmployeeName, LastName, Title, Country, City, Address, HomePhone, Notes) VALUES ('5', 'Steven', 'Steven Buchanan', 'Buchanan', 'Sales Manager', NULL, NULL, NULL, '(71) 555-4848', 'Steven Buchanan graduated from St. Andrews University, Scotland, with a BSC degree in 1976.  Upon joining the company as a sales representative in 1992, he spent 6 months in an orientation program at the Seattle office and then returned to his permanent post in London.  He was promoted to sales manager in March 1993.  Mr. Buchanan has completed the courses "Successful Telemarketing" and "International Sales Management."  He is fluent in French.');
